
<style>

body  {
    -ms-overflow-style: none;  /* IE and Edge */
     scrollbar-width: none;  /* Firefox */
     cursor: default;
}

::-webkit-scrollbar {
    display: none;
} 

.svg-text {
    font-stretch: 0%;
    font-size: 1em;
  white-space: nowrap; /* Prevents text wrapping */
}

.svg-container {
  width: 100%; /* Makes sure the container does not stretch */
  height: 100%; 
  display: flex;
  align-items: center; 
  justify-content: center; 
  background-color: red;
}

svg {
        display: block;
        margin: auto;
        width:100%;
       }

.thinned {
  vector-effect: non-scaling-stroke;
  font-size: 24px;
  font-stretch: 200%;
}

@keyframes marquee {
    0% { transform: translateX(-50%); }  /* Start centered */
    100% { transform: translateX(0); }  /* Move left continuously */
}
.marquee-container {
    width: 100%;
    overflow: hidden;
    display: flex;
}
.marquee {
    display: flex;
    white-space: nowrap;
    animation: marquee 100s linear infinite;
}


.photo-marquee-container {
    width: 100%;
    height: 100%;
    overflow: hidden;
    display: flex;
    align-items: center;
    white-space: nowrap;
    background: transparent;
    border-radius: 8px;
}
.photo-marquee {
    display: flex;
    animation: marquee 20s linear infinite;
}
.photo-marquee img {
    width: 5%;
    /* height: auto; */
    margin-right: 10px; /* Space between images */
    /* border-radius: 8px; */
}
@keyframes photo-marquee {
    0% { transform: translateX(0); }
    100% { transform: translateX(-50%); } /* Move by half for smooth looping */
}


.accessibilityIconIdle{
    vector-effect: non-scaling-stroke;
 

}


               
</style>

<script>
 export default {
    data() {
                return {
                    accessibilityToolsVisibility: false,
                    images: [
                        "model11.png",
                        "model_11_1.png",
                        "model6.png",
                        "model10.png",
                        "model10_1.png",
                        "model13.png",
                        "model14.png",
                        "model15.png",
                        "model12.png",
                        "model16.png",
                        "vaseserena.png"
                    ],
                    currentIndex: 0, 
                    svgWidth: window.innerWidth,  // Start with the current screen width
                    svgHeight: window.innerHeight, // Start with the current screen height
                    learnMoreFill: "#FCFCCE", 
                    openArtistsFill: "#FFEDF4", 
                    openCollectionsFill: "#FFEDF4", 
                    openEventsFill: "#FFEDF4", 
                    openArtistsTextFill: "#D400A6",
                    openCollectionsTextFill: "#D400A6",
                    openEventsTextFill: "#D400A6",
                    

                    aboutNodeShadow:"#F1AFDD", 
                    artistsNodeShadow:"#F1AFDD", 
                    collectionsNodeShadow:"#F1AFDD", 
                    eventsNodeShadow:"#F1AFDD", 

                    fontSize:"24px", 
                    viewBoxWidth: 1440,  // Replace with your actual SVG viewBox width
                    viewBoxHeight: 1068,
                };
            },

            computed: {
    scaleFactors() {
        const scaleX = this.svgWidth / this.viewBoxWidth;
        const scaleY = this.svgHeight / this.viewBoxHeight;
        // Instead of using the minimum scale, let's try using scaleX 
        // since we primarily want to fix horizontal stretching
        return {
            x: scaleX,
            y: scaleY,
            // Adding a slightly larger scale to make text more visible
            // uniform: scaleX * 1.5  // Adjust this multiplier as needed
            uniform: scaleY * 1.5  // Adjust this multiplier as needed

        };
    }
},
            
            methods: {

                openAccessibilityTools(){
                    this.accessibilityToolsVisibility = !this.accessibilityToolsVisibility;
                },

                nextImage() {
                    this.currentIndex = (this.currentIndex + 1) % this.images.length;
                },
                prevImage() {
                    this.currentIndex = (this.currentIndex - 1 + this.images.length) % this.images.length;
                }, 

            updateSize() {
            this.svgWidth = window.innerWidth;
            this.svgHeight = window.innerHeight;
        }, 

        aboutNodeHover(){
            this.learnMoreFill = "#E7EB17"
            this.aboutNodeShadow = "#D400A6"
        }, 

        aboutNodeLeave(){
            this.learnMoreFill ="#FCFCCE"
            this.aboutNodeShadow="#F1AFDD"
        }, 

        artistsNodeHover(){
            this.openArtistsTextFill = "white"
            this.openArtistsFill = "#D400A6"
            this.artistsNodeShadow = "#D400A6"
        }, 

        artistsNodeLeave(){
            this.openArtistsTextFill = "#D400A6"
            this.openArtistsFill ="#FFEDF4"
            this.artistsNodeShadow="#F1AFDD"
        }, 

        collectionsNodeHover(){
            this.openCollectionsTextFill = "white"
            this.openCollectionsFill = "#D400A6"
            this.collectionsNodeShadow = "#D400A6"
        }, 

        collectionsNodeLeave(){
            this.openCollectionsTextFill = "#D400A6"
            this.openCollectionsFill ="#FFEDF4"
            this.collectionsNodeShadow="#FFEDF4"
        }, 


       eventsNodeHover(){
            this.openEventsTextFill = "white"
            this.openEventsFill = "#D400A6"
            this.eventsNodeShadow = "#D400A6"
        }, 

        eventsNodeLeave(){
            this.openEventsTextFill = "#D400A6"
            this.openEventsFill ="#FFEDF4"
            this.eventsNodeShadow="#FFEDF4"
        }, 
    },

                mounted() {
                    window.addEventListener("resize", this.updateSize);
                },

                beforeUnmount() {
                    window.removeEventListener("resize", this.updateSize);
                }
            };
 
</script>

